import React from 'react';
import '../styles/admin.css';

const AdminHome = () => {
    return (
        <div>
            <div className='admin-header'>
                <h2>Home</h2>
            </div>
            <div className='admin-content px-3'>
                <h2>Home</h2>
            </div>
        </div>
    );
};

export default AdminHome;
